import Axios from './lib';

const options = {
  headers: {'1': '2'}
}
const subscription = Axios.get('http://google.ca', options).subscribe(response => console.log(response.status));
const subscription2 = Axios.get('http://baidu.com', options).subscribe(response => console.log(response.status));
subscription.unsubscribe();
subscription2.unsubscribe();
